import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { createClassroom } from '../api';
import '../styles/ClassroomForm.css';

const ClassroomForm = ({ token }) => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    name: '',
    capacity: 30,
    type: 'Lecture Hall',
    faculty: '',
    department: ''
  });
  
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleNumberChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: parseInt(value, 10) || 0
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    try {
      await createClassroom(formData, token);
      navigate('/classrooms');
    } catch (err) {
      console.error('Error creating classroom:', err);
      setError(err.detail || 'Failed to create classroom. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="classroom-form-container">
      <h2>Add New Classroom</h2>
      {error && <div className="error-message">{error}</div>}
      
      <form onSubmit={handleSubmit} className="classroom-form">
        <div className="form-group">
          <label htmlFor="name">Classroom Name/Number</label>
          <input
            type="text"
            id="name"
            name="name"
            value={formData.name}
            onChange={handleChange}
            required
            placeholder="E.g., A101, Lab 3, etc."
          />
        </div>

        <div className="form-group">
          <label htmlFor="capacity">Capacity</label>
          <input
            type="number"
            id="capacity"
            name="capacity"
            min="1"
            max="500"
            value={formData.capacity}
            onChange={handleNumberChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="type">Type</label>
          <select
            id="type"
            name="type"
            value={formData.type}
            onChange={handleChange}
            required
          >
            <option value="Lecture Hall">Lecture Hall</option>
            <option value="Laboratory">Laboratory</option>
            <option value="Seminar Room">Seminar Room</option>
            <option value="Computer Lab">Computer Lab</option>
            <option value="Conference Room">Conference Room</option>
            <option value="Studio">Studio</option>
            <option value="Auditorium">Auditorium</option>
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="faculty">Faculty</label>
          <input
            type="text"
            id="faculty"
            name="faculty"
            value={formData.faculty}
            onChange={handleChange}
            required
            placeholder="Enter faculty name"
          />
        </div>

        <div className="form-group">
          <label htmlFor="department">Department</label>
          <input
            type="text"
            id="department"
            name="department"
            value={formData.department}
            onChange={handleChange}
            required
            placeholder="Enter department name"
          />
        </div>

        <div className="form-actions">
          <button type="button" onClick={() => navigate('/classrooms')} className="btn-cancel">
            Cancel
          </button>
          <button type="submit" className="btn-submit" disabled={loading}>
            {loading ? 'Adding...' : 'Add Classroom'}
          </button>
        </div>
      </form>
    </div>
  );
};

export default ClassroomForm;
